from sage.all import *
from itertools import combinations
from numba import njit

num = 15
discard = 250

@njit(inline='always')
def majority(a, b, c):
  return (a & b) ^ (b & c) ^ (c & a)
@njit(inline='always')
def parity(reg):
    reg ^= (reg >> 16)
    reg ^= (reg >> 8)
    reg ^= (reg >> 4)
    reg ^= (reg >> 2)
    reg ^= (reg >> 1)
    return reg & 1

class LFSR:
  def __init__(self, len, reg, fp, ff):
    self.len = len
    self.reg = reg
    self.fp = fp
    self.ff = ff

  def clock(self):
    self.reg <<= 1
    t = parity(self.reg & self.fp)
    self.reg = (self.reg & self.ff) ^ t

  def get(self, idx):
    return ((self.reg >> idx) & 1)

def x_to_z(r123: list[int], r4: int):
  R1 = LFSR(19, 0, 0xE4000, 0x7FFFF)
  R2 = LFSR(22, 0, 0x622000, 0x3FFFFF)
  R3 = LFSR(23, 0, 0xCC0000, 0x7FFFFF)
  R4 = LFSR(17, 0, 0x26200, 0x1FFFF)
  z = [0 for _ in range(208)]
  R1.reg = (1 + 2 * r123[0])
  R2.reg = (1 + 2 * r123[1])
  R3.reg = (1 + 2 * r123[2])
  R4.reg = 1 + 2 * r4

  for i in range(discard + 208):
    maj = majority(R4.get(1), R4.get(6), R4.get(15));
    if maj == R4.get(15): R1.clock()
    if maj == R4.get(6): R2.clock()
    if maj == R4.get(1): R3.clock()

    if i >= discard:
      z[i - discard] = majority(R1.get(1), R1.get(6), R1.get(15)) ^ majority(R2.get(3), R2.get(8), R2.get(14)) ^ majority(R3.get(4), R3.get(15), R3.get(19)) ^ R1.get(11) ^ R2.get(1) ^ R3.get(0)

    R4.clock()

  return z

def quadratic(reg):
  reg = list(map(int, list(reg)))
  newreg = []
  for i, j in combinations(range(len(reg)), 2):
    newreg.append(reg[i] * reg[j])
  return newreg

