#independent to r4 -> no need to be in for r4 loop
XinvT = []
for i in range(15):
  XT_i = []
  for j in range(656):
    r1, r2, r3 = r1r2r3_init[j]
    r1 = str(bin(r1))[2:].zfill(18)
    r2 = str(bin(r2))[2:].zfill(21)
    r3 = str(bin(r3))[2:].zfill(22)
    XT_i.append([1] + quadratic(r1) + quadratic(r2) + quadratic(r3) + list(map(int, list(r1))) + list(map(int, list(r2))) + list(map(int, list(r3))))
  XinvT.append(matrix(GF(2), XT_i).inverse())
  
r1r2r3_xored = [list(map(lambda x: [x[j] ^ n0_to_ni[i][j] for j in range(3)], r1r2r3_init)) for i in range(15)]
C1513 = list(combinations(range(15), 13))

#%%
import os
from concurrent.futures import ProcessPoolExecutor, as_completed
from functools import partial
from tqdm import tqdm

def process_r4(r4, r1r2r3_xored, XinvT, H, C1513, Hr_cand):
    from sage.all import save, GF, matrix, block_matrix
    ans_cand = []
    M_Ni = [H * (XinvT[i] * matrix(GF(2), list(map(lambda x: x_to_z(x, r4 ^ n0_to_ni[i][3]), r1r2r3_xored[i])))).T 
            for i in range(15)]
    
    for combi in C1513:
        passcombi = False
        
        M_r4 = block_matrix([M_Ni[i] for i in combi], ncols=1)
        Hr = block_matrix([Hr_cand[i] for i in combi], ncols=1)
        
        Aug = M_r4.augment(Hr)
        
        Aug.echelonize()
        
        nonzerorow = 48 * 13 - 1
        while Aug[nonzerorow, -2] == 0:
            if Aug[nonzerorow, -1] == 1:
                passcombi = True
                break
            else:
                nonzerorow -= 1
        if passcombi:
            continue
          

        if Aug.submatrix(nonzerorow - 61 + 1, 656 - 61, 61, 61) == matrix.identity(GF(2), 61):
            r1r2r3_cand = [i[0] for i in Aug.submatrix(nonzerorow - 61 + 1, 656, 61, 1)]
            ans_cand.append((r4, combi, r1r2r3_cand))
        
    if ans_cand:
        save(ans_cand, f"cand_results/{r4:05x}.sobj")
    return r4

def run_process_r4_parallel(r1r2r3_xored, XinvT, H, C1513, Hr_cand, max_workers=4):
    os.makedirs("cand_results", exist_ok=True)

    task_fn = partial(
        process_r4,
        r1r2r3_xored=r1r2r3_xored,
        XinvT=XinvT,
        H=H,
        C1513=C1513,
        Hr_cand=Hr_cand
    )

    futures = []
    with ProcessPoolExecutor(max_workers=max_workers) as executor:
        for r4 in range(2**16-1, 0, -1):
            futures.append(executor.submit(task_fn, r4))

        for future in tqdm(as_completed(futures), total=len(futures)):
            r4_checkpoint = future.result()
            if r4_checkpoint is not None and r4_checkpoint % 16 == 0:
                with open("index.txt", "w") as f:
                    f.write(f"{r4_checkpoint}\n")
run_process_r4_parallel(r1r2r3_xored, XinvT, H, C1513, Hr_cand, max_workers=4)